import './title.css'


class Title extends React.Component {
    render() {
        return (
            <div>
                <div><form> <label>Description</label><input class="form-control form-control-lg" type="text" placeholder="Enter company name"></input></form></div>
            </div>
        )
    }
}

export default Title;
